import React from 'react'
import { Document, Page } from 'react-pdf';
import Resume from '../../resume.pdf';

const resume = () => {
    return (
        <div
        style={{
          height: "100%",
          width: "100%",
          overflow: "auto",
          paddingRight: "20px",
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
        }}
      >
        <Document file={Resume}>
            <Page pageNumber='1' />
        </Document>
      </div>
    )
}

export default resume
